2.1.5.	Заказчик обязуется предъявить при оформлении Предварительного заказ-наряда следующие документы:
•	свидетельство о государственной регистрации транспортного средства либо иной документ, подтверждающий право владения автомобилем;
•	документ, удостоверяющий личность представителя Заказчика и доверенность на право сдачи автомобиля на ремонт/техническое обслуживание, и его получение после окончания ремонта/технического обслуживания, подписание представителем Заказчика всех необходимых документов в рамках настоящего Договора, в том числе, но не ограничиваясь: получение счетов, актов и иных документов, право распоряжаться денежными средствами Заказчика с целью оплаты технического обслуживания и ремонта автомобиля.

3.2.	Исполнитель, в зависимости от видов выполненных работ, предоставляет следующие гарантии:
•	на слесарные работы – 6 (шесть) месяцев;
•	электрические работы – 3 (три) месяца;
На установленные при проведении ремонта и (или) технического обслуживания автомобиля (-ей) Заказчика оригинальные запасные части и аксессуары гарантия устанавливается заводом- изготовителем.

3.6.	Исполнитель не несет ответственность за:
•	естественный износ отдельных элементов, в том числе быстро изнашивающихся;
•	повреждения, возникшие вследствие неквалифицированного использования поставленного оборудования;
•	повреждения, которые могут возникнуть из-за отсутствия систематического профилактического осмотра;
•	неисправности, которые возникли в результате самостоятельного ремонта и установки Заказчиком дополнительного оборудования или ремонта и установки оборудования вне станции сервисного центра Исполнителя.

3.7.	Гарантия утрачивает силу, если:
•	были внесены какие–либо изменения в устройство автомобиля без согласия Исполнителя;
•	произошла авария из-за непроизводственных повреждений (не по вине Исполнителя);
•	автомобиль стал непригодным для использования по вине третьих лиц, либо в результате действия непреодолимой силы;
•	оригинальные запасные части, установленные Исполнителем в процессе ремонта, были заменены нестандартными запасными частями, либо подвергались разборке или ремонту без участия и уведомления Исполнителя.
